<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Interactive Floor Plan</title>
    <style>
    /* styles.css */

    body {
        font-family: Arial, sans-serif;
    }

    #floor-plan-container {
        width: 100%;
        max-width: 600px;
        margin: 0 auto;
    }

    .room {
        fill: lightblue;
        stroke: black;
        stroke-width: 2;
    }

    .room:hover {
        fill: blue;
        cursor: pointer;
    }

    #info-box {
        margin-top: 20px;
        padding: 10px;
        border: 1px solid #ccc;
        background-color: #f9f9f9;
    }
    </style>
</head>

<body>
    <div id="floor-plan-container">
        <svg xmlns="http://www.w3.org/2000/svg" width="507" height="808">
            <rect width="100%" height="100%" fill="white" />
            <image
                xlink:href="data:image/png;base64,"
                x="0" y="0" width="507" height="808" />
        </svg>
    </div>
    <div id="info-box"></div>
    <script>
    // scripts.js

    document.addEventListener('DOMContentLoaded', function() {
        const rooms = document.querySelectorAll('.room');
        const infoBox = document.getElementById('info-box');

        rooms.forEach(room => {
            room.addEventListener('mouseover', function() {
                const info = this.getAttribute('data-info');
                infoBox.innerHTML = info;
            });

            room.addEventListener('mouseout', function() {
                infoBox.innerHTML = '';
            });
        });
    });
    </script>
</body>

</html>